import { useEffect, useState } from 'react';
import { BrowserRouter, Route, Link, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <nav>
        <div>
          <Link to="/">Home</Link> 
        </div>
        <Menu/>
        <div>
          <Link to="/login">로그인</Link>
        </div>
      </nav>
      <main>
        메인 화면
      </main>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />

        <Route path="/account" element={<View />} />
        <Route path="/transfer" element={<Transfer />} />
        <Route path="/savings" element={<Savings />} />
        <Route path="/loan" element={<Loan />} />
        <Route path="/card" element={<Card />} />
      </Routes>
    </BrowserRouter>
  );
}

//홈화면
function Home(){
  return(
  <div>
    배너, 상품 목록
  </div>)
}

//로드 페이지 전환시
function loading(redi){

}

function Login() {
  return (
    <div>
      <form className='LoginForm' action="">
        ID: <input type='text'></input>
        PassWord <input type='text'></input>
        <button>로그인</button>
      </form>
    </div>
  );
}

function Menu(){
  const [menu, setMenu] = useState({
    "계좌": "/account",
    "이체": "/transfer",
    "적금": "/savings",
    "대출": "/loan",
    "카드": "/card"
  });

  const [child, setChild] ={
    "/view":["/card", "/account"],
    "/transfer":["/account", "/child"],
    "/savings":["/account"],
    "/loan":["basic"],
    "/card":["/check", "/credit"]
  }

  //css 사용해서 menuBox a { display: block;}
  const menuList = Object.keys(menu).map(x => 
    <li className='MenuBox'>
      <Link to={menu[x]}>{x}</Link>
    </li>
  )
  return (
  <div className='menu'>
    <ul>
      {menuList}
    </ul>
    <ViewChidMenu/>
  </div>)
}

//메뉴 부분 컴포넌트
function View(){
  return(
  <div>
    조회화면
  </div>)
}

function Transfer(){
  return(
  <div>
    이체화면
  </div>)
}

function Savings(){
  return(
  <div>
    적금화면
  </div>)
}

function Loan(){
  return(
  <div>
    대출화면
  </div>)
}

function Card(){
  return(
  <div>
    카드화면
  </div>)
}

//하위 메뉴
function ViewChidMenu(){
  const [menu, setMenu] = useState({
    "계좌조회": "/view",
    "카드조회": "/",
  });

    //css 사용해서 menuBox a { display: block;}
  const menuList = Object.keys(menu).map(x => 
    <li className='MenuBox'>
      <Link to={menu[x]}>{x}</Link>
    </li>
  )
  return (
  <div className='ViewChildMenu'>
    <ul>
      {menuList}
    </ul>
  </div>)
}

//배너
function Banner(){
  const [content, setContent] = {}

  useEffect(()=>{
    //배너 목록을 가져오는 api
    fetch("")
      .then(data=>{
        setContent(JSON.parse(data))
      })
  }, [content])
}

export default App;
